import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';

// 取得 public/index.html 中的 root 元素
const container = document.getElementById('root');
const root = createRoot(container);

// 掛載 App 元件
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
